def fib_primes(n):

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    fib_seq = [0, 1]
    for i in range(2, n):
        fib_seq.append(fib_seq[-1] + fib_seq[-2])
    fib_primes = [num for num in fib_seq if is_prime(num)]
    result = 2
    for num in fib_primes:
        result *= num
    return result

